import React from 'react';
import './header.css';

const Header = () => {
    return (
        <div className="profile__header section__padding" id="home">
            <div className="profile__header-content">
                <h1 className="gradient__text">4th-Year Full-Stack Developer</h1>
                <p>Passionate about creating web applications that solve real-world problems.</p>
                <ul>
                    <li>Front-End Development</li>
                    <li>Back-End Development</li>
                    <li>React, Node.js, Express, MongoDB</li>
                    <li>Responsive Web Design</li>
                </ul>
                <button className="cta-button">View My Work</button>
            </div>
        </div>
    );
}

export default Header
